INSERT INTO `webstore_event` VALUES (1,'Felipe Calderon at the IOP\'s JFK Forum','felipe-calderon-at-the-iop-s-jfk-forum','2013-04-25',42.00,1,'Felipe Calderon (right), the 56th President of Mexico (2006-2012) and the Inaugural Angelopoulos Global Public Leaders Fellow at the Harvard Kennedy School, speaks at the JFK Forum with David T. Ellwood (left), the Dean of Harvard Kennedy School. Calderon discussed a variety of issues, including Mexican economic interests, the level of violence in Mexico, and Mexico\'s role in Latin America.',''),(2,'Artshow','artshow','2013-04-25',42.00,2,'Spectators enjoy the Harvard Students Arts Show on Mount Auburn Street Thursday afternoon.',''),(3,'Damon','damon','2013-04-25',42.00,3,'MATT DAMON- ARTS FIRST MEDAL CEREMONY. SARAH P REID. APRIL 25 2013, SANDERS THEATER.',''),(4,'1000 Paper Cranes','1000-paper-cranes','2013-04-24',42.00,3,'Students Shanyi Gu \'15 and Colin Zwaniger \'13 fold paper cranes Wednesday evening, April 24th, in the Winthrop JCR. Their work was part of an effort to make 1000 paper cranes as a tribute to last week\'s tragic events.\n\nPhotographer: Hannah K. Rasmussen',''),(5,'Candlelight Vigil','candlelight-vigil','2013-04-24',42.00,3,'Students from all over Boston gathered around the Memorial Church to reflect upon sexual assault and rape culture on Wednesday evening. This candlelight vigil was the final event culminating a series of Take Back the Night events hosted by the Office of Sexual Assault Prevention and Response.\n\nBy: JIHO KANG',''),(6,'A Streetcar Named Desire','a-streetcar-named-desire','2013-04-24',42.00,2,'Cast members of Harvard Radcliffe Dramatic Club\'s \"A Streetcar Named Desire\" rehearse in the Adams Pool Theater. The play opened Thursday evening at 7:30 PM, with subsequent shows on Friday evening, Saturday afternoon, and Saturday evening.\n\nPhotographer: Hannah K. Rasmussen',''),(7,'Take Back The Night March','take-back-the-night-march','2013-04-24',42.00,3,'IWRC, OHCDB, Harvard Socialists, SLAM, Take Back the Night, OSAPR',''),(8,'Presidential Leadership','presidential-leadership','2013-04-24',42.00,3,'David Gergen moderates a conversation with Graham Allison, Nancy F. Koehn and Joseph S. Ny, Jr. on the Presidential Leadership and the Rise of American Power\n\nPhoto: Christophe A.T. Van',''),(9,'Experimenter Assembly 4/24/13','experimenter-assembly-4-24-13','2013-04-24',42.00,4,'',''),(10,'Boston Strong Wall / Yellow Flowers','boston-strong-wall-yellow-flowers','2013-04-24',42.00,3,'Tiana A Abdulmassih',''),(11,'The Porch Opening','the-porch-opening','2013-04-24',42.00,5,'',''),(12,'Hilary Putnam @ Hillel','hilary-putnam-hillel','2013-04-23',42.00,3,'Professor Emeritus and Rolf Schock Prize Laureate in Philosophy  Hilary Putnam gives a talk at Harvard Hillel\'s Beren Hall on the topics of Jewish strands, which are a component of his book \"Jewish Philosophy as a Guide to Life\"-Emmanuel Figueroa\'15',''),(13,'Labour Rally','labour-rally','2013-04-23',42.00,3,'',''),(14,'Andre Agassi','andre-agassi','2013-04-23',42.00,3,'Andre Agassi talks to students about his tennis career and perfectionism, giving the advice to understand when things are out of one\'s control. Agassi was a guest of the Leadership Institute at Harvard College on Tuesday.',''),(15,'Men\'s Soccer Spring Game 2013 vs BU','men-s-soccer-spring-game-2013-vs-bu','2013-04-23',42.00,6,'Harvard Soccer Stadium, 4-23-13; Byline: ROBERT F. WORLEY',''),(16,'Ashton Carter','ashton-carter','2013-04-23',42.00,5,'',''),(17,'Neurobiology of Sexual Assault','neurobiology-of-sexual-assault','2013-04-23',42.00,3,'Dr. James W. Hopper, Clinical Instructor of Psychology at Harvard Medical School, discusses the brain\'s response to sexual assault. Dr. Hopper presented on the Neurobiology of Sexual Assault to a group of students, faculty members, and members of various counseling organizations on Tuesday evening, April 23rd, at the PBHA.\nPhotographer: Hannah K. Rasmussen',''),(18,'Women\'s Lacrosse at BC','women-s-lacrosse-at-bc','2013-04-22',42.00,6,'',''),(19,'Artist Spotlight - Zak Aossey','artist-spotlight-zak-aossey','2013-04-22',42.00,2,'Zak Aossey \'14 is an emerging rap/hip-hop artist, set to release an EP this summer.',''),(20,'Senate Debate Markey Lynch April 22','senate-debate-markey-lynch-april-22','2013-04-22',42.00,3,'Senate Debate between Stephen F. Lynch and Ed Markey for the Special Election Monday April 22.',''),(21,'Questions In Translation','questions-in-translation','2013-04-22',42.00,1,'The 33rd Raimundo Lida Memorial Lecture featured a round table discussion, \"Questions in Translation: Ask the Translator!\"\nThe panel included Edith Grossman, Elvira DiFabio, Daniel Aguirre-Oteiza, and Nicole Legani.',''),(22,'Mock Hindu Same-Sex Marriage','mock-hindu-same-sex-marriage','2013-04-21',42.00,3,'',''),(23,'What the Hell Freshman Musical 2013','what-the-hell-freshman-musical-2013','2013-04-21',42.00,2,'Class of 2016 puts up its entirely-freshman-produced musical titled What The Hell in Agassiz Theater. Byline: John Y. Wang \'16',''),(24,'Women\'s Tennis vs Yale 4-21-13','women-s-tennis-vs-yale-4-21-13','2013-04-21',42.00,6,'Harvard vs Yale; Byline: ROBERT F. WORLEY',''),(25,'Senior Spotlight Portraits','senior-spotlight-portraits','2013-04-21',42.00,2,'NZUEKOH N. NCHINDA',''),(26,'ELEGANZA2013','eleganza2013','2013-04-20',42.00,7,'SARAH P REID. April 21 2013, Gordon Track.',''),(27,'Senior Week and Commencement','senior-week-and-commencement','2013-04-20',42.00,7,'Senior Week and Commencement.',''),(28,'Reforma Migratoria','reforma-migratoria','2013-04-20',42.00,7,'NZUEKOH N. NCHINDA',''),(29,'Bomber Press Conference','bomber-press-conference','2013-04-19',42.00,3,'',''),(30,'Celebrations after Marathon Bomber Captured - Harvard Square','celebrations-after-marathon-bomber-captured-harvard-square','2013-04-19',42.00,3,'Tiana A. Abdulmassih',''),(31,'Harvard Square After Bombing Suspect\'s Arrest','harvard-square-after-bombing-suspect-s-arrest','2013-04-19',42.00,5,'Harvard Square begins to come back to life after the lockdown and later arrest of the Boston Marathon bombing suspect on April 19, 2013. (Byline: ROBERT F. WORLEY)',''),(32,'Carpenter Center','carpenter-center','2013-04-19',42.00,7,'Photog: Magdalena Kala',''),(33,'Lockdown Friday after Marathon','lockdown-friday-after-marathon','2013-04-19',42.00,3,'Tiana A Abdulmassih',''),(34,'Manhunt on Friday','manhunt-on-friday','2013-04-19',42.00,3,'Students enjoy the warm weather despite the active manhunt for the second suspect of the Boston Marathon bombing on Friday.\n\nPolice actively guard the perimeter of the yard as students play games of frisbee, trampoline ball, and football during the manhunt for the second suspect of the Boston Marathon bombing on Friday.\n\nPhotographer: Jennifer Y. Yao',''),(35,'Beep Ball','beep-ball','2013-04-18',42.00,6,'',''),(36,'Landscape Talk','landscape-talk','2013-04-18',42.00,2,'Photographer: Bridget R. Irvine',''),(37,'Scaling Compassion','scaling-compassion','2013-04-18',42.00,3,'A panel of professors, psychiatrists, youth empowerment leaders, and journalists speaks about introducing compassion and kindness to the younger generation on Thursday. Held in the Gutman library, this was the final event in a series of three workshops centered on the theme of compassion.  \n\nPhotographer: Jennifer Y. Yao',''),(38,'Stephen Wolfram Talk','stephen-wolfram-talk','2013-04-18',42.00,3,'Dr. Stephen Wolfram, scientist and founder of Wolfram Research, educates students about Wolfram Alpha, a program which he created along with Mathematica. Dr. Wolfram\'s talk took place on Thursday afternoon in Science Center D. NZUEKOH N. NCHINDA',''),(39,'MentalHealthHolyokeCenter','mentalhealthholyokecenter','2013-04-18',42.00,7,'The Holyoke Center is the home of Harvard\'s Mental Health Services.\n\nPhotos by Christopher J Magnani',''),(40,'Advocate Book Discussion','advocate-book-discussion','2013-04-17',42.00,2,'-Katherine M. Kulik',''),(41,'Veterans Flags','veterans-flags','2013-04-17',42.00,3,'',''),(42,'College Vigil to Commemorate Boston Marathon Explosion','college-vigil-to-commemorate-boston-marathon-explosion','2013-04-16',42.00,3,'Members of the Harvard community gather outside Memorial Church at a candlelight vigil to commemorate all those who suffer as a result of the Boston Marathon explosion. Byline: John Y. Wang \'16',''),(43,'Live of the Mind','live-of-the-mind','2013-04-16',42.00,3,'Prof. Steven A. Pinker and Prof. Howard E. Gardner engage in a dialogue about the workings of the human mind and their work. The two studied at Harvard University together as graduate students. Byline: John Y. Wang \'16',''),(44,'Marathon Bombing - Boston Common Vigil','marathon-bombing-boston-common-vigil','2013-04-16',42.00,3,'Photog: Magdalena Kala',''),(45,'CES Event','ces-event','2013-04-16',42.00,3,'Kenneth Nelson, Associate Professor of Sociology at the Swedish Institute for Social Research at Stockholm University, presents \"When It Rains, It Pours? Social Rights, Inequality and Multiple Deprivation in Europe\". This event took place at the Center for European Studies on Tuesday. -Katherine M. Kulik',''),(46,'Marathon Bombing','marathon-bombing','2013-04-16',42.00,3,'Mark Kelsey',''),(47,'Boston City Address','boston-city-address','2013-04-16',42.00,5,'',''),(48,'Mira Nair','mira-nair','2013-04-16',42.00,7,'Parul Agarwal',''),(49,'Marathon Monday Bombing - night','marathon-monday-bombing-night','2013-04-15',42.00,3,'Tiana A. Abdulmassih',''),(50,'Kaledoscope Jam','kaledoscope-jam','2013-04-15',42.00,2,'Photo: Tarik Adnan Moon',''),(51,'Fashion-Portraits-Spring-2013','fashion-portraits-spring-2013','2013-04-15',42.00,2,'Photo: Tarik Adnan Moon',''),(52,'Marathon Bombing - Harvard Square','marathon-bombing-harvard-square','2013-04-15',42.00,3,'',''),(53,'Israel Commemoration Celebration at Hillel','israel-commemoration-celebration-at-hillel','2013-04-15',42.00,1,'Israel Commemoration Celebration at Hillel Monday April 15, 2013.\nPhotos of guest speaker Benny Morris, visiting professor of history from Ben-Gurion University, Beersheba, Israel, giving his talk \"1948.\"\nOther Photos of Israeli students Tom Dan, \'13 and Zaki Djemal, \'15.\nPhoto of food and refreshments.',''),(54,'Quincy Construction','quincy-construction','2013-04-15',42.00,3,'Quincy Renovations: Seniors Object',''),(55,'Fifteen Hottest','fifteen-hottest','2013-04-14',42.00,7,'Fifteen Hottest Freshmen \n\nPhoto: Christophe A. T. Van',''),(56,'Baseball v. Holy Cross','baseball-v-holy-cross','2013-04-14',42.00,6,'Mark Kelsey',''),(57,'Womens Tennis vs Princeton','womens-tennis-vs-princeton','2013-04-14',42.00,6,'Harvard Tennis vs. Princeton\n\nPhoto: Christophe A. T. Van',''),(58,'Women\'s Tennis v. UPenn - 04/14/2013','women-s-tennis-v-upenn-04-14-2013','2013-04-14',42.00,6,'Photographer: Ozdemir Vayisoglu\nPlayers: Hideko Tachibana \'13, Kristin Norton \'13, Hannah Morrill \'14, Hai-Li Kong \'16, Amy He \'16, Amanda Lin \'16',''),(59,'Alternative Yardfest Shea Rose','alternative-yardfest-shea-rose','2013-04-14',42.00,3,'Shea Rose and her band perform at the alternative yardfest in Eliot house courtyard\n\nPhoto: Tarik Adnan Moon',''),(60,'Los 80s Son Nuestros','los-80s-son-nuestros','2013-04-14',42.00,2,'Tiana A Abdulmassih',''),(61,'Yardfest','yardfest','2013-04-13',42.00,3,'Mark Kelsey. More to come',''),(62,'Men\'s Volleyball v. Rutgers','men-s-volleyball-v-rutgers','2013-04-13',42.00,6,'At Harvard. Harvard 3 - 0 Rutgers. http://www.gocrimson.com/sports/mvball/2012-13/boxscores/20130413_zai6.xml. NZUEKOH N. NCHINDA',''),(63,'Men\'s Lacrosse vs Penn 4-13-13','men-s-lacrosse-vs-penn-4-13-13','2013-04-13',42.00,6,'Harvard win, 8-7 F(OT), Harvard Stadium; Byline: ROBERT F. WORLEY',''),(64,'Men\'s LAX vs. Penn - 4/13/13','men-s-lax-vs-penn-4-13-13','2013-04-13',42.00,6,'',''),(65,'Redline Ultimate','redline-ultimate','2013-04-13',42.00,6,'On Wednesday, April 10, Harvard Redline took on the professional Boston Whitecaps. The game ended in defeat, but not by much, with the final score being a fairly close 14-10. Photos by Victoria Gill.',''),(66,'Crew vs. Brown 4/13','crew-vs-brown-4-13','2013-04-13',42.00,6,'Photog: Magdalena Kala',''),(67,'Arts First','arts-first','2013-04-13',42.00,2,'Bryan Li',''),(68,'Galactic - HOB','galactic-hob','2013-04-13',42.00,2,'Tiana A Abdulmassih 4.12.13',''),(69,'Adams Pool Theater','adams-pool-theater','2013-04-12',42.00,7,'The mysterious Adams Pool Theater. NZUEKOH N. NCHINDA',''),(70,'Womens and Gender Advocacy Fair','womens-and-gender-advocacy-fair','2013-04-12',42.00,3,'Britni D. de la Cretaz and Louis Evans discuss street harassment at the Women\'s and Gender Advocacy Fair on Friday afternoon.\n-Grace E.J. Aranow',''),(71,'Covering-Islam','covering-islam','2013-04-11',42.00,3,'Covering Islam: Telling Muslims\' Stories in Photos, Words, and Video\n\nA discussion panel\n\nProfessor Ali Asani, photojournalist Karim B. Khelifa, NY Times columnist Souad Mekhennet, and multimedia journalist Alexandra Gracia engages in a discussion about Islam in news media. They talk about topics ranging from the participation of Muslim journalists in the media to Islamophobia in the US.\n\nPhotog: Tarik Adnan Moon',''),(72,'Divest Harvard Rally','divest-harvard-rally','2013-04-11',42.00,8,'',''),(73,'Hammonds\' Book Series: Jill Lepore','hammonds-book-series-jill-lepore','2013-04-11',42.00,1,'',''),(74,'Urbanism Spirituality Initiative','urbanism-spirituality-initiative','2013-04-11',42.00,3,'Professor Dav√≠d Carrasco speaks about the richness of the history of Latin America at the Symposium on Urbanism, Spirituality, and Well-being. The interdisciplinary panel of academics shared their views on Thursday evening in Science Center Hall E. NZUEKOH N. NCHINDA.',''),(75,'Low cost high-impact solutions for the bottom 2 billion','low-cost-high-impact-solutions-for-the-bottom-2-billion','2013-04-11',42.00,5,'',''),(76,'Mira Nair Screening','mira-nair-screening','2013-04-10',42.00,3,'',''),(77,'Reinventing Urban Democracy','reinventing-urban-democracy','2013-04-10',42.00,3,'Somerville\'s Mayor Curtatone and New York City Council member Brad Lander speak at Harvard Kennedy School\'s \"Reinventing Urban Democracy\" event on Wednesday afternoon.  The politicians discussed the benefits and drawbacks of participatory budgeting in urban environments.\n-Grace E.J. Aranow',''),(78,'Marlene Zuk Public Lecture','marlene-zuk-public-lecture','2013-04-10',42.00,3,'Marlene Zuk, famed author and Professor at the University of Minnesota, delivers a public lecture at the Geological Lecture Hall titled \"Paleofantasy: What Evolution Really Tells Us About Sex, Diet, and How We Live\". The lecture is part of the \"Evolution Matters\" Series from the Harvard Museum of Natural History.- Emmanuel Figueroa\'15',''),(79,'Galileo Forgery Talk','galileo-forgery-talk','2013-04-10',42.00,3,'Attendees listen intently to Nick Wilding, during his lecture about the technology and process behind identification of forged Galileo books. Wilding, of Georgia State University, spoke Wednesday evening in Houghton Library.\n\nAlexander Jaffe',''),(80,'Digging','digging','2013-04-10',42.00,3,'DJ Premier, 9th Wonder, and Pete Rock present \"Digging\" the Music of Hiphop: These are the Standards. This event, which featured a discussion on the current state of hip hop, took place Wednesday evening at Memorial Church. -Katherine M. Kulik',''),(81,'Mute Poetry','mute-poetry','2013-04-09',42.00,3,'Hannah K. Rasmussen\nMute Poetry Speaking Pictures, Leonard Barkan',''),(82,'Pat Levitt - Neurobio/Psych Talk','pat-levitt-neurobio-psych-talk','2013-04-09',42.00,3,'Pat Levitt speaks about the development of complex social behaviors in humans and other animals. Levitt, of the University of Southern California, lectured Tuesday afternoon in Fong Auditorium.\n\nAlexander Jaffe',''),(83,'Quincy House Lottery','quincy-house-lottery','2013-04-09',42.00,3,'Quincy House announces its House lottery results today, which includes the reveal of those who got the highly desired suites in New Quincy and the reveal of those that are going to be living in what will be the renovated Quincy building. Photos taken by Emmanuel Figueroa\'15',''),(84,'Junot Diaz','junot-diaz','2013-04-08',42.00,3,'Photog: Magdalena Kala',''),(85,'Is America Working?','is-america-working-','2013-04-08',42.00,3,'Nina Easton moderates Monday night\'s panel discussion between Senior Fellow Paula Dobriansky, Distinguished Senior Fellow Ben Heineman, Professor of Business and Government Roger Porter, and Professor Lawrence Summers on \"Is America Working? What Business and Government Can Do.\"\n-Grace E.J. Aranow',''),(86,'IOP Forum - Is America Working?','iop-forum-is-america-working-','2013-04-08',42.00,3,'Nina Easton moderates a discussion on \"Is America Working? What Businesses and Governments can do\" with Paula Dobriansky, Ben Heineman, Roger Porter and Lawrence H. Summers.\n\nPhoto: Christophe A. T. Van',''),(87,'Fogg Museum of Art','fogg-museum-of-art','2013-04-07',42.00,3,'Harvard\'s Fogg Museum of Art undergoes major renovation to expand in size. Byline: JOHN Y. WANG \'16',''),(88,'Brattle Street Chamber Players Spring Concert','brattle-street-chamber-players-spring-concert','2013-04-07',42.00,2,'Brattle Street Chamber Players presents a concert in collaboration with the Columbia Classical Performers, in include works by Bach, Beethoven, Mendelssohn, Harvard\'s own Phillip Golub \'16 and more. Byline: JOHN Y. WANG \'16',''),(89,'Men\'s Tennis vs. Columbia 04-06-2013','men-s-tennis-vs-columbia-04-06-2013','2013-04-07',42.00,6,'4-3, Murr Center. Byline: JOHN Y. WANG \'16\nurl: http://www.gocrimson.com/sports/mten/2012-13/releases/201304062bbihu',''),(90,'Islamic Awareness Month','islamic-awareness-month','2013-04-07',42.00,7,'Dr. Mohamed Abutaleb speaks to the Harvard Islamic Society on Saturday night concerning the relationship between science and Islam.\n-Grace E.J. Aranow',''),(91,'Grad School Humanities vs. Science','grad-school-humanities-vs-science','2013-04-07',42.00,7,'',''),(92,'Africa Night','africa-night','2013-04-07',42.00,3,'Africa Night \r\n\r\nPhoto: Christophe A. T. Van',''),(93,'Women\'s Water Polo vs Brown 4-3-2013','women-s-water-polo-vs-brown-4-3-2013','2013-04-07',42.00,6,'Byline: ROBERT F. WORLEY',''),(94,'Crew vs. Cornell (06/4/2013)','crew-vs-cornell-06-4-2013-','2013-04-07',42.00,6,'Courtesy of Jan Bockstiegel',''),(95,'Flume','flume','2013-04-07',42.00,2,'Anneli Tostar',''),(96,'Men\'s Lacrosse vs. Cornell 4-6-13','men-s-lacrosse-vs-cornell-4-6-13','2013-04-06',42.00,6,'Harvard loss, 14-12 (Soldiers Field Harvard Stadium); Byline: ROBERT F. WORLEY\r\nBox Score: http://gocrimson.com/sports/mlax/2012-13/boxscores/20130406_jiag.xml',''),(97,'Dating Event - Cabot','dating-event-cabot','2013-04-06',42.00,3,'Tiana A. Abdulmassih',''),(98,'River Charles Ensemble Concert','river-charles-ensemble-concert','2013-04-06',42.00,2,'River Charles Ensemble Concert on April 5th.\n\nJiho Kang',''),(99,'Men and Women Heavy Crew 4/6/13','men-and-women-heavy-crew-4-6-13','2013-04-06',42.00,6,'Anneli Tostar',''),(100,'Thomas Heatherwick','thomas-heatherwick','2013-04-05',42.00,2,'Thomas Heatherwick renowned British architect responsible for the Olympic torch and new double-decker buses',''),(101,'DOGS - Rehearsal','dogs-rehearsal','2013-04-05',42.00,2,'Tiana A. Abdulmassih\nLoeb Ex','');
